import {BrowserRouter, Route, Switch} from 'react-router-dom';
import StorePicker from './StorePicker';
import App from './App';
const Router = () => {
    return (
        <BrowserRouter>
            <Switch>
                <Route exact path='/' component={StorePicker}/>
                <Route path="/store/:storeId" componet={App}/>
            </Switch>
        </BrowserRouter>
    )
}

export default Router
